		public class mobjlightinfo_t
		{
			public float radius;
			public Vector4 color;
			public int saturation;
			public int hue;
			public float brightness;
			public int type;
			public bool castShadow;

			public void makeColor()
			{
				double r, g, b;
				double s = (double)saturation / 100.0;
				double h = (double)hue;
				double v = (double)brightness;

				int i;
				double f, p, q, t;
				if (s == 0) 
				{
					r = g = b = v;
				}
				else
				{
					h /= 60.0;			// sector 0 to 5
					i = (int)h;
					f = h - (double)i;			// factorial part of h
					p = v * ( 1 - s );
					q = v * ( 1 - s * f );
					t = v * ( 1 - s * ( 1 - f ) );
					switch( i ) 
					{
						case 0:
							r = v;
							g = t;
							b = p;
							break;
						case 1:
							r = q;
							g = v;
							b = p;
							break;
						case 2:
							r = p;
							g = v;
							b = t;
							break;
						case 3:
							r = p;
							g = q;
							b = v;
							break;
						case 4:
							r = t;
							g = p;
							b = v;
							break;
						default:		// case 5:
							r = v;
							g = p;
							b = q;
							break;
					}
				}

				color.X = (float)r;
				color.Y = (float)g;
				color.Z = (float)b;
				color.W = 1;
			}
		}


