		internal static void saveMobType()
		{
			FileStream fs = new FileStream("../../../../HereticXNAContent/mobjtypes.bin", FileMode.Create);
			BinaryWriter bw = new BinaryWriter(fs);
			int i = 0;
			foreach (mobjinfo_t mobT in mobjinfo)
			{
				if (mobT.selfIllumB > 0 ||
					mobT.selfIllumT > 0 ||
					mobT.light != null)
				{
					bw.Write(i);
					bw.Write(mobT.selfIllumB);
					bw.Write(mobT.selfIllumT);
					bw.Write(mobT.light != null);
					if (mobT.light != null)
					{
						bw.Write(mobT.light.radius);
						bw.Write(mobT.light.hue);
						bw.Write(mobT.light.saturation);
						bw.Write(mobT.light.brightness);
						bw.Write(mobT.light.type);
						bw.Write(mobT.light.castShadow);
					}
				}
				++i;
			}
			fs.Flush();
		}

		internal static void loadMobType()
		{
			BinaryReader br = new BinaryReader(new FileStream("Content/mobjtypes.bin", FileMode.Open));
			while (br.BaseStream.Position < br.BaseStream.Length)
			{
				int i = br.ReadInt32();
				mobjinfo_t mobT = mobjinfo[i];
				mobT.selfIllumB = br.ReadSingle();
				mobT.selfIllumT = br.ReadSingle();
				bool hasLight = br.ReadBoolean();
				if (hasLight)
				{
					mobT.light = new mobjlightinfo_t();
					mobT.light.radius = br.ReadSingle();
					mobT.light.hue = br.ReadInt32();
					mobT.light.saturation = br.ReadInt32();
					mobT.light.brightness = br.ReadSingle();
					mobT.light.type = br.ReadInt32();
					mobT.light.castShadow = br.ReadBoolean();
					mobT.light.makeColor();
				}
			}
		}
	}
